import React from "react";
import { Flex } from "rebass";
import { theme } from "../theme";

const ResourcesPage = () => {
  return (
    <Flex
      justifyContent="center"
      alignItems="center"
      height="100vh"
      flexDirection="column"
      bg={theme.colors.jet}
    ></Flex>
  );
};

export default ResourcesPage;
